import React from 'react';
import { NavLink } from 'react-router-dom';


const Navigation = () => {

    handleHover = ()=>{
        document.querySelector('.navigation ul').addEventListener('mouseover', ()=>{
            console.log(document.querySelector('.nav-active'))
        })
    }

    return (

        <nav className="navigation">
            <div className="brand">NK</div>

            <ul>
                <NavLink to='/' exact activeClassName='nav-active' >
                    <li>Home</li>
                </NavLink>

                <NavLink to='/about' exact activeClassName='nav-active' >
                    <li>About</li>
                </NavLink>

                <NavLink to='/skills' exact activeClassName='nav-active' >
                    <li>Skills</li>
                </NavLink>

                <NavLink to='/works' exact activeClassName='nav-active' >
                    <li>Works</li>
                </NavLink>

                <NavLink to='/contact' exact activeClassName='nav-active' >
                    <li>Contact</li>
                </NavLink>
            </ul> 

            <div className="location">
                <p>Strasbourg</p>
                <p>France</p>
            </div>
        </nav>
    );
};

export default Navigation;
